import ImageSlider from '../../components/ImageSlider/ImageSlider';
import classes from './Innovation.module.css';

const Innovation = (props) => {



    const imageProperties = [{"image_details": "slide first","image":"/images/Innovation/Innovation1.jpg","category":"web"},
                             {"image_details": "slide second","image":"/images/Innovation/Innovation2.jpg","category":"mobile"},
                             {"image_details": "slide third","image":"/images/Innovation/Innovation3.jpg","category":"automation"},
                             {"image_details": "slide first","image":"/images/Innovation/Innovation4.jpg","category":"web"},
                             {"image_details": "slide second","image":"/images/Innovation/Innovation5.jpg","category":"mobile"}
                            ];
    const radioProperties = [{"id":0,"category":"Welcome to our innovation hub","checked": false},
                            {"id":1,"category":"Makes life easier","checked": false},
                            {"id":2,"category":"What can we do for you","checked": false},
                            {"id":3,"category":"Mobile App (Android & IOS)","checked": false},
                            {"id":4,"category":"Automation","checked": false},
                           ];

    const componentDescription = "descriptionOfWhatWeDo";

    const imageTimeInterval = 11000;

    const images = imageProperties.map(imageDetail => {
        return <img src={imageDetail.image} alt={imageDetail.category} key={imageDetail.image} />

    });

    console.log("What we do");

    return <div className={classes.Innovation}>
                <ImageSlider imageProperties={images} 
                radioProperties={radioProperties} 
                componentDescription={componentDescription}
                imageSliderTimeInterval={imageTimeInterval}/>
           </div>

}

export default Innovation;
